import { Routes, Route } from "react-router-dom";
import UserList from "../components/Crud User/UserList";
import AddUser from "../components/Crud User/AddUser";
import EditUser from "../components/Crud User/EditUser";
import Login from "../components/Page/Login";
import Register from "../components/Page/Register";
import AppLayout from "../components/Layout/AppLayout";
import Home from ""

const AppRoutes = () => {
  return (
    <Routes>
      {/* Rute yang tidak menggunakan AppLayout */}
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />

      {/* Rute yang menggunakan AppLayout */}
      <Route path="/" element={<AppLayout />}>
        <Route index element={<Home />} />
        <Route path="user-list" element={<UserList />} />
        <Route path="add-user" element={<AddUser />} />
        <Route path="edit-user/:id" element={<EditUser />} />
      </Route>
    </Routes>
  );
};

export default AppRoutes;
